  marks: [
    {
      name: gridMarker
      type: symbol
      from: {data: "table"}
      encode: {
        update: {
          fill: {
            scale: bubbleColor
            field: doc_count
          }
          size: {scale: "gridSize", field: "doc_count"}
          xc: {signal: "datum.x"}
